import "../css/mobileNav.css";

const openMenu = (menu) => {
  menu.classList.add("open");
};

const closeMenu = (menu) => {
  menu.classList.remove("open");
};

const MobileNav = () => {
  const clickHandler = () => {
    const menu = document.querySelector(".mobile-nav--container");
    const menuOpen = document.querySelector(".mobile-nav--container.open");

    menuOpen === undefined ? openMenu(menu) : closeMenu(menu);
  };
  return (
    <>
      <div className="mobile-nav--container">
        <div className="circle-container">
          <div className="circle" onClick={clickHandler}></div>
        </div>
      </div>
    </>
  );
};

export default MobileNav;
